(1,'Cosmetic Surgery','Cosmetic Surgery - Skin Cancer - Plastic Surgery - Reconstructive Surgery - Cosmetic Medicine\r\n\r\nRamsay Cosmetic Surgery is a leading provider of cosmetic surgery &amp; non surgical treatments incl. liposuction, tummy tuck &amp; breast surgery. \r\n\r\nRamsay Health Care Cosmetic Surgery is dedicated to providing a personal, friendly and professional cosmetic surgery service.','far fa-user-md',1,'2020-08-03 18:32:11'),
(3,'Ophthalmologist','Ophthalmology - Cornea - Cataract - Glaucoma\r\n\r\nOphthalmology is a branch of medicine that involves the study and treatment of eye disorders and diseases.','far fa-user-md',1,'2020-08-03 18:32:59'),
(4,'Heart Surgery','Cardiology\r\nDiagnosis and treatment of heart disease.\r\n\r\nCardiac Catheterisation - A cardiac catheterisation, or coronary angiogram, is a special test to find out if you have any problems with the coronary arteries.\r\n\r\nPercutaneous Coronary Intervention - A PCI is a procedure to widen or unblock an artery using a small inflatable balloon.','far fa-user-md',1,'2020-09-18 21:38:37'),
(5,'Weight Loss Surgery','Bariatric Surgery, Weight Loss Surgery','far fa-user-md',1,'2020-09-18 21:41:09'),
(6,'General Medicine','General Medicine is concerned with the diagnosis and treatment of internal diseases.\r\nGeneral Medicine treatments offered by Ramsay Health Care UK include:\r\n\r\nColonoscopy\r\nA colonoscopy is a procedure to look at the inside of the large bowel (colon) using a flexible telescope.\r\n\r\nEndoscopy (Upper GI)\r\nGastrointestinal (GI) endoscopy is a procedure to look at the oesophagus and stomach.\r\n\r\nFlexible Sigmoidoscopy\r\nA flexible sigmoidoscopy is a procedure to look at the inside of the left, lower part of the colon (large bowel) using a flexible telescope.\r\n\r\nGastroenterology\r\nThe study of the digestive system and its disorders.','far fa-user-md',1,'2020-09-18 21:42:37'),
