(14,'newreferraluser','New Referral User','New My Eye Record & Care (MERC) referral submitted by {Opto_fname}, {Opto_lname}','<p><span style=\"font-family: Verdana;\">Dear {med_sec_fullname} {med_sec_lname},</span></p><p><span style=\"font-family: Verdana;\"><br></span></p><p></p><p><span style=\"font-family: Verdana;\">You have received a new MERC</span><span style=\"font-family: Verdana;\"> referral from {Opto_fname}, {Opto_lname}. Please log on to the {clinic_name} Portal to view the patient and referral details.</span><br></p><p><span style=\"font-family: Verdana;\">View referral: {URL}</span></p><p><br></p><div data-mce-style=\"padding: 0px 5px;\" droid=\"\" sans\",=\"\" \"lucida=\"\" sans-serif;=\"\" font-size:=\"\" 13.3333px;=\"\" padding:=\"\" 0px=\"\" 5px;\"=\"\"><font face=\"Verdana\">Best Regards,</font></div><div data-mce-style=\"padding: 0px 5px;\" droid=\"\" sans\",=\"\" \"lucida=\"\" sans-serif;=\"\" font-size:=\"\" 13.3333px;=\"\" padding:=\"\" 0px=\"\" 5px;\"=\"\"><span style=\"font-family: Verdana;\">{clinic_name}</span></div><div data-mce-style=\"padding: 0px 5px;\" droid=\"\" sans\",=\"\" \"lucida=\"\" sans-serif;=\"\" font-size:=\"\" 13.3333px;=\"\" padding:=\"\" 0px=\"\" 5px;\"=\"\"><span style=\"font-family: Verdana;\"><br></span></div><div data-mce-style=\"padding: 0px 5px;\" droid=\"\" sans\",=\"\" \"lucida=\"\" sans-serif;=\"\" font-size:=\"\" 13.3333px;=\"\" padding:=\"\" 0px=\"\" 5px;\"=\"\"><div data-mce-style=\"padding: 0px 5px;\" droid=\"\" sans\",=\"\" \"lucida=\"\" sans-serif;=\"\" font-size:=\"\" 13.3333px;=\"\" padding:=\"\" 0px=\"\" 5px;\"=\"\" style=\"color: rgb(34, 34, 34);\"><span style=\"font-family: Poppins, Poppins, sans-serif; color: red;\"><span style=\"font-weight: bolder; font-family: Verdana;\">*DO NOT REPLY TO THIS E-MAIL*</span></span><br style=\"color: rgb(0, 0, 0); font-family: Poppins, Poppins, sans-serif;\"><span style=\"color: rgb(0, 0, 0); font-family: Verdana;\">This is an automated e-mail message sent from our