(15,'newpatiengcp','Notification to MERC Secretary when the patient agrees to join My Eye Record & Care','A new patient for {clinic_name}','<div><span style=\"font-family: Verdana;\">Dear </span><font face=\"Verdana\">{gcp_fname} {gcp_lname},</font></div><div><font face=\"Verdana\"><br></font></div><div>A new patient has agreed to join the {clinic_name}. Please click the link below to view patient details.<br></div><div><br></div><div><font face=\"Verdana\" style=\"color: rgb(57, 132, 198); text-decoration-line: underline;\">MERC SECRETARY Dashboard</font></div><div><font face=\"Verdana\"><br></font>Please do the needful.</div><div><br></div><div><span style=\"font-family: Verdana;\">Best Regards,</span><br></div><div><span style=\"font-family: Verdana;\">{clinic_name}</span></div><div><br></div><div><br></div><div><b style=\"color: rgb(255, 0, 0);\"><span style=\"font-family: Verdana;\">*DO NOT REPLY TO THIS E-MAIL*</span></b></div><div><br></div><div><span style=\"font-family: Verdana;\">This is an automated e-mail message sent from our support system. Do not reply to this e-mail.</span></div>',1,'2021-10-08 18:12:21'),
(16,'referral_notification_to_medical_secretary','Referral notification to Medical Secretary','New My Eye Record & Care (MERC) referral submitted by {Opto_fname, Opto_lname}','<div><span style=\"font-family: Verdana;\">Dear {med_sec_fname, lname},</span></div><div><br></div><div><br></div><div><span style=\"font-family: Verdana;\">You have received a new MERC referral from {Opto_fname, Opto_lname}. Please log on to the </span><span style=\"font-family: Verdana;\">My Eye Record & Care p</span><span style=\"font-family: Verdana;\">ortal to view the patient and referral details.  </span></div><div><br></div><div><br></div><div><span style=\"font-family: Verdana;\">View referral {dashboard login link}</span></div><div><br></div><div><br></div><div><span style=\"font-family: Verdana;\">Best Regards,</span></div><div><span style=\"font-family: Verdana;\">{clinic_name}</span></div><div><br></div><div><br></div><div><b style=\"color: rgb(255, 0, 0);\"><span style=\"font-family: Verdana;\">*DO NOT REPLY TO THIS E-MAIL*</span></b></div><div><br></div><div><span style=\"font-family: Verdana;\">This is an automated e-mail message sent from our support system. Do not reply to this e-mail.</span></div>',1,'2021-10-08 18:12:46'),
(17,'notification_to_optician_for_follow_up','Notification to Optician for follow up','My Eye Record & Care (MERC) follow up appointment is due for {patient_title} {patient_fname, lname} {nhs_number}','<div><span style=\"font-family: Verdana;\">Dear {user_fname} {user_lname},</span><br></div><div><font face=\"Verdana\"><br></font></div><div><br></div><div><div><font face=\"Verdana\">The following patient is due for MERC review on {followup_date}. The patient details can be viewed by clicking the link below</font></div><div><font face=\"Verdana\"><br></font></div><div><font face=\"Verdana\" style=\"color: rgb(107, 173, 222); text-decoration-line: underline;\"><a href=\"https://referral.worcesterglaucoma.co.uk/admin\" target=\"_blank\">Optom Dashboard</a></font></div><div><font face=\"Verdana\"><br></font></div><div><font face=\"Verdana\">Please organise pre-appointment tests and submit the reports and images as soon as possible.</font></div></div><div><br></div><div><br></div><div><span style=\"font-family: Verdana;\">Best Regards,</span></div><div><span style=\"font-family: Verdana;\">{clinic_name}</span></div><div><br></div><div><br></div><div><b style=\"color: rgb(255, 0, 0);\"><span style=\"font-family: Verdana;\">*DO NOT REPLY TO THIS E-MAIL*</span></b></div><div><br></div><div><span style=\"font-family: Verdana;\">This is an automated e-mail message sent from our support system. Do not reply to this e-mail.</span></div>',1,'2021-10-13 17:10:14'),
(18,'notification_to_medical_secretary_for_follow_up_appointment','Notification to Medical secretary for follow up appointment','{patient_title} {patient_fname, lname} {nhs_number} Is due for a review','<div><font face=\"Verdana\">Dear </font><span style=\"font-family: Verdana;\">med_sec_fname</span><font face=\"Verdana\"> {med_sec_lname},</font></div><div><font face=\"Verdana\"><br></font></div><div><font face=\"Verdana\"><br></font></div><div><font face=\"Verdana\">The following patient has been tested and report/scans/images have been uploaded. Please click the link to view</font></div><div><font face=\"Verdana\"><br></font></div><div><font face=\"Verdana\"><u style=\"color: rgb(57, 132, 198);\">Medical Secretary Dashboard</u></font></div><div><font face=\"Verdana\"><br></font></div><div><font face=\"Verdana\">Please contact the patient to arrange an appointment with an ophthalmologist for a review.</font></div><div><font face=\"Verdana\"><br></font></div><div><font face=\"Verdana\"><br></font></div><div><font face=\"Verdana\">Best Regards,</font></div><div><font face=\"Verdana\">{clinic_name}</font></div><div><font face=\"Verdana\"><br></font></div><div><font face=\"Verdana\"><br></font></div><div><font face=\"Verdana\" style=\"font-weight: bold; color: rgb(255, 0, 0);\">*DO NOT REPLY TO THIS E-MAIL*</font></div><div><font face=\"Verdana\"><br></font></div><div><font face=\"Verdana\">This is an automated e-mail message sent from our support system. Do not reply to this e-mail.</font></div>',1,'2021-07-14 21:44:29'),
(19,'notification_to_patient_for_follow_up','Notification to Patient for follow up','My Eye Record & Care follow up appointment is due for {patient_title} {patient_fname, lname] ({nhs_number})','<div><div><font face=\"Verdana\">Dear {patient_title} {patient_fname, lname}</font></div><div><font face=\"Verdana\"><br></font></div><div><font face=\"Verdana\"><br></font></div><div><font face=\"Verdana\">This is a reminder about your eye review which is due on {followup_date}.</font></div><div><font face=\"Verdana\"><br></font></div><div><font face=\"Verdana\">For your further eye checks, please contact the below hospital to book your appointment:</font></div><div><font face=\"Verdana\"> </font></div><div><font face=\"Verdana\">Hospital name: {hospital_name}</font></div><div><font face=\"Verdana\">Address: {hospital_address}</font></div><div><font face=\"Verdana\">Contact no.: {hospital_number}</font></div><div><font face=\"Verdana\">Email: {email}</font></div><div><font face=\"Verdana\"><br></font></div><div><font face=\"Verdana\">We strongly recommend that you attend this appointment as there may be changes to the back of your eyes that you don’t notice; this is an essential part of your My Eye Record & Care</font><span style=\"font-family: Verdana;\">.</span></div><div><font face=\"Verdana\"><br></font></div><div><font face=\"Verdana\">If you need to cancel or reschedule your appointment, please get in touch with the hospital as soon as possible.</font></div></div><div><br></div><div><br></div><div><span style=\"font-family: Verdana;\">Best Regards,</span></div><div><span style=\"font-family: Verdana;\">{clinic_name}</span></div><div><br></div><div><br></div><div><b style=\"color: rgb(255, 0, 0);\"><span style=\"font-family: Verdana;\">*DO NOT REPLY TO THIS E-MAIL*</span></b></div><div><br></div><div><span style=\"font-family: Verdana;\">This is an automated e-mail message sent from our support system. Do not reply to this e-mail.</span></div>',1,'2021-10-08 18:13:26'),
(20,'notification_to_the_patient_for_appointment_booking_at_hospital','Notification to the patient for Appointment booking at Hospital','Book your appointment with {hospital_name} for My Eye Record & Care (MERC) check up.','<div><span style=\"font-family: Verdana;\">Dear </span><font face=\"Verdana\">{patient_title} {patient_fullname},</font></div><div><br></div><div><div><div><font face=\"Verdana\">Thank You for showing interest in our </font><span style=\"font-family: Verdana;\">My Eye Record & Care</span><font face=\"Verdana\">.</font></div><div><font face=\"Verdana\"><br></font></div></div><div><font face=\"Verdana\"><div>For your further eye checks, please contact the below hospital to</div><div>book your appointment:</div><div><br></div></font></div><div><font face=\"Verdana\">Hospital name: {hospital_name}</font></div><div><font face=\"Verdana\">Address: </font><span style=\"font-family: Verdana;\">{hospital_address}</span></div><div><font face=\"Verdana\">Contact no.: </font><span style=\"font-family: Verdana;\">{hospital_number}</span></div><div><span style=\"font-family: Verdana;\">Email: </span><font face=\"Verdana\">{email}</font><br></div><div><font face=\"Verdana\"><br></font></div><div><span style=\"font-family: Verdana;\">We look forward to providing you with the best </span><span style=\"font-family: Verdana;\">Eye Care</span><span style=\"font-family: Verdana;\">.</span><br></div></div><div><br></div><div><span style=\"font-family: Verdana;\">Best Regards,</span><br></div><div><span style=\"font-family: Verdana;\">{clinic_name}</span></div><div><br></div><div><br></div><div><b style=\"color: rgb(255, 0, 0);\"><span style=\"font-family: Verdana;\">*DO NOT REPLY TO THIS E-MAIL*</span></b></div><div><br></div><div><span style=\"font-family: Verdana;\">This is an automated e-mail message sent from our support system. Do not reply to this e-mail.</span></div>',1,'2021-10-08 18:13:45'),
(21,'notification_to_the_hospital_for_patient_details','Notification to the Hospital for patient details','Book appointment for {patient_name} with doctor {Docter_name}','<div><span style=\"font-family: Verdana;\">Dear,</span></div><div><font face=\"Verdana\"><br></font></div><div><span style=\"font-family: Verdana;\">This is to inform you that our {patient name} he/she will be going to come to your hospital for the check-up. Kindly book the appointment slot as per availability </span><br></div><div><font face=\"Verdana\"><br></font></div><div><font face=\"Verdana\">Our patient detail are as follow</font></div><div><div><font face=\"Verdana\">Name: {name}</font></div><div><font face=\"Verdana\">Address: {address} </font></div><div><font face=\"Verdana\">Contact no.: {mobile}</font></div><div><font face=\"Verdana\">Email: {email}</font></div></div><div><font face=\"Verdana\"><br></font></div><div><font face=\"Verdana\">We look forward to providing you with the best</font></div><div><br></div><div><span style=\"font-family: Verdana;\">Best Regards,</span></div><div><span style=\"font-family: Verdana;\">{clinic_name}</span></div><div><br></div><div><br></div><div><b style=\"color: rgb(255, 0, 0);\"><span style=\"font-family: Verdana;\">*DO NOT REPLY TO THIS E-MAIL*</span></b></div><div><br></div><div><span style=\"font-family: Verdana;\">This is an automated e-mail message sent from our support system. Do not reply to this e-mail.</span></div>',1,'2021-10-08 15:39:32'),
(22,'notification_to_gcp_sec_for_patient_follow_up_coming','Notification to MERC Secretary for patient coming follow up ','New follow up generated for {patient_fname, patient_lname}, Please update payment status','<div><span style=\"font-family: Verdana;\">Dear </span><font face=\"Verdana\">{gcp_sec_fname} gcp_lname,</font></div><div><font face=\"Verdana\"><br></font></div><div><font face=\"Verdana\"><br></font></div><div><font face=\"Verdana\"><div>The following patient is due for MERC review on {followup_date}. The patient details can be viewed by clicking the link below</div><div><br></div><div><span style=\"color: rgb(57, 132, 198); text-decoration-line: underline;\">GCP Sec Dashboard</span></div><div><br></div><div>Please check his/her payment status and update the system.</div></font></div><div><br></div><div><br></div><div><span style=\"font-family: Verdana;\">Best Regards,</span></div><div><span style=\"font-family: Verdana;\">{clinic_name}</span></div><div><br></div><div><br></div><div><b style=\"color: rgb(255, 0, 0);\"><span style=\"font-family: Verdana;\">*DO NOT REPLY TO THIS E-MAIL*</span></b></div><div><br></div><div><span style=\"font-family: Verdana;\">This is an automated e-mail message sent from our support system. Do not reply to this e-mail.</span></div>',1,'2021-10-08 15:40:06');
