insert  into `kk_page`(`id`,`page_name`,`page_url`,`page_data`,`page_title`,`meta_tag`,`meta_description`,`predefined`,`last_modified`,`date_of_joining`) values 
(1,'home','','{\"slider\":[{\"img\":\"media-9387376976082b3fb2f4b2.jpg\",\"tag\":\"Glaucoma Care Plan\",\"content\":\"Welcome to award-winning healthcare from experts you can trust, book today. Our unique connected health approach means we can support you from diagnosis to recovery. Glaucoma occurs when the drainage tubes, trabecular meshwork, within the eye become blocked. This prevents eye fluid, aqueous humour, from draining properly. When the fluid cannot drain properly, pressure builds up. This is called intraocular pressure.\\r\\nThis results in damage to the optic nerve, which can lead to blindness. Glaucoma often affects both eyes in varying degrees. If it is diagnosed early enough, further damage to vision can be prevented.\\r\\nThe Glaucoma Care Plan sets out a clear eye care plan for new and long term glaucoma patients by developing and strengthening shared glaucoma care pathway across the primary, community and private eye care services. \\r\\n\"},{\"img\":\"media-9573333046082b3fb35740.jpg\",\"tag\":\"Glaucoma Care Plan\",\"content\":\"Welcome to award-winning healthcare from experts you can trust, book today. Our unique connected health approach means we can support you from diagnosis to recovery. Glaucoma occurs when the drainage tubes, trabecular meshwork, within the eye become blocked. This prevents eye fluid, aqueous humour, from draining properly. When the fluid cannot drain properly, pressure builds up. This is called intraocular pressure.\\r\\nThis results in damage to the optic nerve, which can lead to blindness. Glaucoma often affects both eyes in varying degrees. If it is diagnosed early enough, further damage to vision can be prevented.\\r\\nThe Glaucoma Care Plan sets out a clear eye care plan for new and long term glaucoma patients by developing and strengthening shared glaucoma care pathway across the primary, community and private eye care services. \\r\\n\"},{\"img\":\"media-16288028426082b3fbbab54.jpg\",\"tag\":\"Glaucoma Care Plan\",\"content\":\"Welcome to award-winning healthcare from experts you can trust, book today. Our unique connected health approach means we can support you from diagnosis to recovery. Glaucoma occurs when the drainage tubes, trabecular meshwork, within the eye become blocked. This prevents eye fluid, aqueous humour, from draining properly. When the fluid cannot drain properly, pressure builds up. This is called intraocular pressure.\\r\\nThis results in damage to the optic nerve, which can lead to blindness. Glaucoma often affects both eyes in varying degrees. If it is diagnosed early enough, further damage to vision can be prevented.\\r\\nThe Glaucoma Care Plan sets out a clear eye care plan for new and long term glaucoma patients by developing and strengthening shared glaucoma care pathway across the primary, community and private eye care services. \\r\\n\"}],\"service\":{\"title\":\"WHAT WE DO\",\"description\":\"\",\"picture\":\"media-2009625285f35481706ab3.jpg\"},\"about\":{\"title\":\"Who We Are\",\"block\":[{\"icon\":\"fas fa-user-md\",\"title\":\"Doctor(s)\",\"count\":\"10\"},{\"icon\":\"fas fa-ambulance\",\"title\":\"Room(s)\",\"count\":\"20\"},{\"icon\":\"fas fa-calendar\",\"title\":\"Year of Experience(s)\",\"count\":\"23\"},{\"icon\":\"far fa-clock\",\"title\":\"Opening hours per week\",\"count\":\"40\"}],\"picture\":\"media-4809396195f35493b48240.jpg\",\"description\":\"The Westbourne Centre is a medical centre, bringing together a diverse group of specialists with the support of a committed company to provide state-of-the-art facilities, to enable them to do the highest quality procedures and treatments in the world today.\\r\\n\\r\\nEach specialist is devoted to delivering the safest, least-invasive solution for every patient. As innovators within their specialist areas, our consultants constantly review medical advancements. As good listeners, they are committed to ensuring the chosen option is absolutely right for the individual. From initial consultation through treatment and then aftercare, your consultant is fully engaged every step of the way.\",\"background\":\"media-3474141025f35482504659.jpg\"},\"facility\":{\"title\":\"Why Choose Us\"},\"doctor\":{\"title\":\"Our Team\",\"background\":\"media-20699542415f3549803f006.jpg\"},\"blog\":{\"title\":\"Latest Posts\"},\"testimonial\":{\"title\":\"What People Say\",\"background\":\"media-12856618105f35482d3a094.jpg\"}}','Home','Glaucoma Care Plan','Glaucoma Care Plan',1,'2021-05-04 13:47:53','2019-08-02 00:00:00'),
(2,'services','','{\"facility\":{\"status\":\"1\",\"title\":\"Why Choose Us\"}}','Services','Service | Capri Healthcare | Private Consultation System - Appointment and patient management system','Service | Appointment and patient management system created to simplify ',1,'2020-09-20 23:03:00','2019-08-03 22:49:40'),
